$templateCache.put('description_vt.html','<ion-view view-title="Descripci\xF3">\r\n   <ion-content class="my-body">\r\n\r\n\r\n      <div ng-show="showSpinner" class="my-spinner-center">\r\n          <ion-spinner icon="spiral" class="spinner-dark "></ion-spinner>\r\n      </div>\r\n\r\n        <div class="list card">\r\n            <div class="item item-avatar my-header-card">\r\n              <div class="item-image mapa-list-id" ng-class="isDownloaded() ? \'background-downloaded\' : \'background-no-downloaded\'" >{{mapa.id}}</div>\r\n              <h2 class="mapa-list-name">{{mapa.nom}}</h2>\r\n           </div>\r\n\r\n\r\n             <!--BOTONS -->\r\n              <div ng-show="isDownloaded()" class="item">\r\n                  <div class=" button-bar row">\r\n                     <a ng-click="deleteMapVt(\'\')"\r\n                        class="col-25 button button-35px button-outline icon ion-android-delete"></a>\r\n                     <a class="col-75 button button-35px button-royal icon-left ion-map" ng-click="toggleSpinner()"\r\n                        ui-sref="map_vt({idMap: {{mapa.id}}, type: \'vt\' })">Mapa&nbsp;<i class="icon  ion-ios-arrow-right"></i></a>\r\n                 </div>\r\n\r\n              </div>\r\n\r\n              <div ng-hide="isDownloaded()" class="item button-bar">\r\n                  <a ng-click="initDownloadProcess(\'\')"\r\n                     class="button button-35px button-outline button-royal icon-left ion-android-download"\r\n                     ng-class="{\'disabled\': makeAndroidDisabled()}">\r\n                      Mapa ({{mapa.mb}} MB)\r\n                  </a>\r\n              </div>\r\n              <div class="item" ng-show="makeAndroidDisabled()" >\r\n                <div class="my-card" ng-cloak>\r\n                  <div class="item my-info-item item-text-wrap text-center ">\r\n                    <h3 class="text-color-assertive">\r\n                      <i class="icon ion-alert-circled"></i>&nbsp; La tecnologia vector tiles nom\xE9s est\xE0 disponible a partir de la versi\xF3 5 d\u2019Android. \r\n                    </h3>\r\n                  </div>\r\n                </div>\r\n              </div>\r\n\r\n\r\n\r\n              <div  class="item item-body">\r\n              \r\n                <p>En aquesta versi\xF3 de Catalunya Offline teniu la possibilitat de treballar amb un <b>mapa que cont\xE9 la totalitat del Mapa Topogr\xE0fic de Catalunya</b> a escala 1:25.000. Dins aquest mapa (full 0) podeu gravar rutes i punts de la mateixa manera que en els altres.</p>\r\n\r\n                <p>A difer\xE8ncia dels 77 fulls parcials en que us servim la cartografia com a imatges, en aquest us servim dades vectorials (vector tiles) que pesen significativament menys.</p>\r\n\r\n                <p>En l\u2019\xE0mbit funcional, veureu que aquest mapa permet la rotaci\xF3 i inclinaci\xF3 del punt de vista.</p>\r\n\r\n                <p>A difer\xE8ncia que en els altres fulls, en aquest no hi ha ombra de muntanya perqu\xE8 es tracta d\u2019una imatge molt pesada.</p>\r\n\r\n              </div>\r\n\r\n              <div class="item item-body">\r\n                  <img class="full-image img-description"  ng-src="img/thumbnails/0-catalunya.png">\r\n              </div>\r\n\r\n             <div ng-show="isDownloaded()" class="item">\r\n              <div class="txt-downloaded"><p>Mapa {{mapa.mb}} MB - Descarregat: {{mapa.data_download}}</p></div>\r\n             </div>\r\n\r\n\r\n        </div>\r\n\r\n\r\n\r\n    </ion-content>\r\n</ion-view>\r\n');
